import React from 'react';
import * as transactionManipulations from '../api/transactionManipulations';

export default class TimeTesting extends React.Component {


    render() {
        let timePeriod = {
            lowerBoundry:1,
            upperBoundry:2
        };
        console.log(transactionManipulations.allTransactionsForUserInTimePeriod('gyk',this.props.transations,timePeriod));
        return (
            <div>
                time tester
            </div>
        );
  }
}
